modules/vpc/main.tf.code:
resource "aws_vpc" "this" {
  cidr_block = var.vpc_cidr

  tags = {
    Name = "VPC-${var.name_suffix}"
  }
}

resource "aws_subnet" "public" {
  count             = length(var.public_subnets_cidr)
  vpc_id            = aws_vpc.this.id
  cidr_block        = element(var.public_subnets_cidr, count.index)
  availability_zone = element(var.availability_zones, count.index)

  tags = {
    Name = "Public-Subnet-${count.index}-${var.name_suffix}"
  }
}

resource "aws_internet_gateway" "this" {
  vpc_id = aws_vpc.this.id

  tags = {
    Name = "Internet-Gateway-${var.name_suffix}"
  }
}

resource "aws_route_table" "public" {
  vpc_id = aws_vpc.this.id

  route {
    cidr_block = "0.0.0.0/0"
    gateway_id = aws_internet_gateway.this.id
  }

  tags = {
    Name = "Public-Route-Table-${var.name_suffix}"
  }
}

# Associate public route table with public subnets
resource "aws_route_table_association" "public" {
  count          = length(var.public_subnets_cidr)
  subnet_id      = element(aws_subnet.public.*.id, count.index)
  route_table_id = aws_route_table.public.id
}

modules/vpc/variables.tf.code:
variable "name_suffix" {
  description = "A suffix to append to resources names to ensure uniqueness"
  type        = string
}

variable "vpc_cidr" {
  description = "The CIDR block for the VPC"
  type        = string
}

variable "public_subnets_cidr" {
  description = "A list of CIDR blocks for the public subnets"
  type        = list(string)
}

variable "availability_zones" {
  description = "A list of availability zones in the region"
  type        = list(string)
}

modules/vpc/outputs.tf.code:
output "vpc_id" {
  description = "The ID of the VPC"
  value       = aws_vpc.this.id
}

output "public_subnet_ids" {
  description = "The IDs of the public subnets"
  value       = aws_subnet.public.*.id
}

modules/ec2/main.tf.code:
resource "aws_security_group" "ec2_sg" {
  name_prefix = "ec2-sg-${var.name_suffix}"
  vpc_id      = var.vpc_id

  egress {
    from_port   = 0
    to_port     = 0
    protocol    = "-1"
    cidr_blocks = ["0.0.0.0/0"]
  }

  tags = {
    Name = "EC2-Security-Group-${var.name_suffix}"
  }
}

resource "aws_launch_configuration" "this" {
  name_prefix     = "lc-${var.name_suffix}"
  image_id        = var.ami_id
  instance_type   = var.instance_type
  security_groups = [aws_security_group.ec2_sg.id]

  lifecycle {
    create_before_destroy = true
  }
}

resource "aws_autoscaling_group" "this" {
  name_prefix               = "asg-${var.name_suffix}"
  launch_configuration      = aws_launch_configuration.this.id
  min_size                  = var.asg_min_size
  max_size                  = var.asg_max_size
  desired_capacity          = var.asg_desired_capacity
  vpc_zone_identifier       = var.subnet_ids
  health_check_grace_period = 300
  force_delete              = true

  tag {
    key                 = "Name"
    value               = "ASG-EC2-${var.name_suffix}"
    propagate_at_launch = true
  }
}

resource "aws_alb" "this" {
  name_prefix     = "alb-"  # Shortened to conform with AWS requirements
  subnets         = var.subnet_ids
  security_groups = [aws_security_group.ec2_sg.id]

  tags = {
    Name = "ALB-${var.name_suffix}"
  }
}

resource "aws_alb_target_group" "this" {
  name_prefix = "tg-${var.name_suffix}"
  port        = 80
  protocol    = "HTTP"
  vpc_id      = var.vpc_id
}

resource "aws_alb_listener" "front_end" {
  load_balancer_arn = aws_alb.this.arn
  port              = "80"
  protocol          = "HTTP"

  default_action {
    type             = "forward"
    target_group_arn = aws_alb_target_group.this.arn
  }
}

modules/ec2/variables.tf.code:
variable "name_suffix" {
  description = "A suffix to append to resources names to ensure uniqueness"
  type        = string
}

variable "vpc_id" {
  description = "The VPC ID where resources will be deployed"
  type        = string
}

variable "subnet_ids" {
  description = "A list of subnet IDs for the ALB and Autoscaling Group"
  type        = list(string)
}

variable "ami_id" {
  description = "The AMI ID for the EC2 instances"
  type        = string
}

variable "instance_type" {
  description = "The instance type for the EC2 instances"
  type        = string
}

variable "asg_min_size" {
  description = "The minimum size of the autoscaling group"
  type        = number
}

variable "asg_max_size" {
  description = "The maximum size of the autoscaling group"
  type        = number
}

variable "asg_desired_capacity" {
  description = "The desired capacity of the autoscaling group"
  type        = number
}

modules/ec2/outputs.tf.code:
output "alb_dns_name" {
  description = "The DNS name of the Application Load Balancer"
  value       = aws_alb.this.dns_name
}

output "asg_name" {
  description = "The name of the Autoscaling Group"
  value       = aws_autoscaling_group.this.name
}

outputs.tf.code:
output "vpc_id" {
  value = module.vpc.vpc_id
}

output "public_subnet_ids" {
  value = module.vpc.public_subnet_ids
}

output "alb_dns_name" {
  value = module.ec2.alb_dns_name
}

output "asg_name" {
  value = module.ec2.asg_name
}
